INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES ("仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 122601, 1, 0.029, 0, 105, 1, 110, 101, 1, 160, 0, 1, 1.5);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES ("太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 122401, 2, 0.014, 1, 111, 2, 105, 102, 3, 120, 0, 0, 2.5);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES ("波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 122501, 3, 0.017, 0, 105, 3, 110, 103, 2, 350, 1, 0, 2.5);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES ("海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 107501, 4, 0.016, 1, 105, 4, 110, 104, 3, 130, 0, 0, 1.5);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES ("海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 107601, 5, 0.014, 0, 105, 5, 110, 105, 1, 160, 0, 1, 2.5);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES ("水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 107801, 6, 0.029, 0, 103, 6, 120, 106, 2, 255, 1, 0, 3.5);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES ("優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 110601, 7, 0.013, 0, 103, 7, 120, 107, 1, 160, 0, 1, 3.5);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES ("浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 110401, 8, 0.014, 0, 103, 8, 110, 108, 2, 350, 1, 0, 2.5);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES ("浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 110501, 9, 0.012, 1, 100, 9, 105, 109, 3, 130, 0, 0, 1.5);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES ("浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 115701, 10, 0.014, 0, 103, 10, 105, 110, 1, 200, 0, 1, 2.5);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES ("再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 113601, 11, 0.071, 0, 103, 11, 105, 111, 2, 350, 1, 0, 2.5);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES ("水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 107901, 12, 0.014, 1, 103, 12, 120, 112, 3, 130, 0, 0, 1.5);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES ("バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 108001, 13, 0.022, 0, 105, 13, 110, 113, 2, 200, 0, 1, 1.5);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES ("真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 110301, 14, 0.031, 0, 108, 14, 110, 114, 1, 160, 0, 1, 2.5);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES ("海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 107701, 15, 0.036, 1, 105, 15, 110, 115, 1, 130, 0, 0, 0.5);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES ("粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 113101, 16, 0.048, 0, 95, 16, 110, 116, 2, 350, 1, 0, 3.5);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES ("夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 113301, 17, 0.043, 1, 105, 17, 105, 117, 3, 130, 0, 0, 1.5);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES ("海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 113201, 18, 0.018, 1, 95, 18, 105, 118, 2, 130, 0, 0, 1.5);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES ("夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 117001, 19, 0.021, 0, 108, 19, 110, 119, 2, 160, 0, 1, 2.5);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES ("青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 113501, 20, 0.036, 0, 105, 20, 110, 120, 1, 255, 1, 0, 2.5);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES ("笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 113401, 21, 0.02, 0, 105, 21, 105, 121, 3, 350, 1, 0, 2.5);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES ("海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 110101, 22, 0.018, 1, 105, 22, 110, 122, 1, 130, 0, 0, 2.5);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES ("水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 110001, 23, 0.03, 0, 111, 23, 105, 123, 3, 160, 0, 1, 3.5);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES ("南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 117201, 24, 0.027, 1, 103, 24, 110, 124, 1, 130, 0, 0, 1.5);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES ("海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 117301, 25, 0.02, 0, 108, 25, 105, 125, 2, 160, 0, 1, 3.5);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES ("夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 117401, 26, 0.04, 0, 105, 26, 110, 126, 3, 350, 1, 0, 2.5);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES ("向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 117101, 27, 0.009, 0, 105, 27, 110, 127, 1, 350, 1, 0, 3.5);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES ("渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 122901, 28, 0.022, 0, 105, 28, 120, 128, 1, 255, 1, 0, 3.5);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES ("無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 122801, 29, 0.028, 1, 105, 29, 110, 129, 3, 130, 0, 0, 2.5);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES ("海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 122701, 30, 0.023, 0, 108, 30, 105, 130, 2, 130, 0, 1, 3.5);
